import React from "react";
import {
  Line,
  LineChart,
  Tooltip,
  CartesianGrid,
  Legend,
  XAxis,
  YAxis,
  Label,
  Text
} from "recharts";

const data = [
  {
    date: "2020-02-17",
    uv: 4000,
    pv: 2400,
    amt: 2400
  },
  {
    date: "2020-02-18",
    uv: 3000,
    pv: 1398,
    amt: 2210
  },
  {
    date: "2020-02-19",
    uv: 2000,
    pv: 9800,
    amt: 2290
  },
  {
    date: "2020-02-20",
    uv: 2780,
    pv: 3908,
    amt: 2000
  },
  {
    date: "2020-02-21",
    uv: 1890,
    pv: 4800,
    amt: 2181
  },
  {
    date: "2020-02-22",
    uv: 2390,
    pv: 3800,
    amt: 2500
  },
  {
    date: "2020-02-23",
    uv: 3490,
    pv: 4300,
    amt: 2100
  },
  {
    date: "2020-02-24",
    uv: 4400,
    pv: 5000,
    amt: 2700
  },
  {
    date: "2020-02-25",
    uv: 5000,
    pv: 7600,
    amt: 2000
  },
  {
    date: "2020-02-26",
    uv: 6000,
    pv: 2500,
    amt: 2540
  },
  {
    date: "2020-02-27",
    uv: 8000,
    pv: 2600,
    amt: 2220
  }
];

class Dashchart extends React.Component {
  render() {
    return (
      <LineChart
        width={730}
        height={250}
        data={data}
        margin={{ top: 5, right: 30, left: 20, bottom: 5 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="date" />
        <YAxis
          label={
            <Text x={0} y={0} dx={50} dy={150} offset={0} angle={-90}>
              Hours
            </Text>
          }
        />
        <Tooltip />
        <Legend />
        <Line type="monotone" dataKey="pv" stroke="#006fff" />
        <Line type="monotone" dataKey="uv" stroke="#1bd962" />
      </LineChart>
    );
  }
}

export default Dashchart;
//ReactDOM.render(<Dashchart />, mountNode);
